<center><H3><B>SUBJECTS</H3>The academic year consists of two semesters. At the under graduate
level, the curriculum is spread over three years, except B.Sc. (Hons.)
Agricultural Science and Rural Development, which lasts for four years.
The duration of a semester is approximately 16-18 weeks, each consisting
of six working days with a day order schedule having six hours per day.
In the academic year 2016-17, the college introduced the Choice-Based
Credit System (CBCS). All degree students are expected to earn a
minimum of 135 Credits for the completion of the Under graduate Degree
Course. Besides these credits, they should also put in 30 hours of social
service under PLANET Programme. Students are also encouraged to get
certificates by involving themselves in NSS/NCC/SPORTS &GAMES/
AICUF/ Women’s Cell etc.
The third semester students, besides undergoing the regular curriculum,
also choose one Generic Elective across all the streams. These courses
are career-oriented and which will make them more employable after
completing their respective Degree Course.
Inorder to make the students research-oriented, all the final year students
are to under take a Project Work and submit their Dissertation as well as
take a Viva Voce. All these components of the Degree Curriculum under the
CBCS have to be completed before one gets one’s Under graduate Degree.<BR>
